// it colorises when you return to site but does not erase if you unchecked subiect

function createDoneImg() {
  const img = document.createElement("img");
  img.src = doneimg;
  img.style.cssText = `width:1.5rem; height: 1.5 rem;`;
  return img;
}

function ColoriseLinks() {
  // erase all done links
  document.body.querySelectorAll(".done").forEach((t) => {
    t.classList.remove("done");
    t.querySelectorAll("img").forEach((i) => i.remove());
  });

  // colorise again
  document.body.querySelectorAll("a").forEach((l) => {
    // the link in anchor tag includes a '.html' which does not appear when you navigate to that link
    const reallink = l.href.replace("viewer.html", "viewer");
    if (localStorage.getItem(reallink + "-checked") != "true") return;

    // show that this link has an already done test
    l.classList.add("done");
    if (!l.querySelector("img")) l.appendChild(createDoneImg());
  });
}
// on window.onfocus works only in firefox : dono mate
document.addEventListener("focus", ColoriseLinks);
window.addEventListener("focus", ColoriseLinks);
document.body.addEventListener("focus", ColoriseLinks);
window.addEventListener("load", () => {
  document.body.innerHTML += `<style>
  .done{
    color: green; font-size:1.5rem
  }
  </style>`;
  ColoriseLinks();
});

var doneimg = `data:image/jpeg;base64,`;
